  ChangelogUrl: https://github.com/Azure/azure-sdk-for-python/tree/azure-storage-file-datalake_12.14.0b1/sdk/storage/azure-storage-file-datalake/CHANGELOG.md
  ChangelogContent: |-
    #### Features Added
    - Added support for service version 2023-11-03.
