- Name: azure-storage-blob
  Version: 12.19.0b1
  DisplayName: Storage - Blobs
  ServiceName: Storage
  VersionType: Beta
  Hidden: false
  ChangelogUrl: https://github.com/Azure/azure-sdk-for-python/tree/azure-storage-blob_12.19.0b1/sdk/storage/azure-storage-blob/CHANGELOG.md
  ChangelogContent: |-
    #### Bugs Fixed
    - Deprecated `BlobProperties` as a valid input type to the `blob` parameter on the following APIs:
    BlobServiceClient's `get_blob_client`, ContainerClient's `delete_blob`, `download_blob`, and `get_blob_client`.
    This deprecation change also applies to the `name` parameter on ContainerClient's `upload_blob` API. This change
    applies to both sync and async packages but does not apply to the batch equivalent of any of the listed APIs. If a
    `BlobProperties` is provided, a deprecation warning is raised.

    #### Features Added
    - Added support for service version 2023-11-03.
    - Added `audience` as an optional keyword that can be specified on APIs that have a `credential` parameter. This
    keyword only has an effect when the credential provided is of type `TokenCredential`.
- Name: azure-cosmos
  Version: 4.5.2b1
  DisplayName: Cosmos DB
  ServiceName: Cosmos DB
  VersionType: Beta
  Hidden: false
  ChangelogUrl: https://github.com/Azure/azure-sdk-for-python/tree/azure-cosmos_4.5.2b1/sdk/cosmos/azure-cosmos/CHANGELOG.md
  ChangelogContent: |-
    #### Bugs Fixed
    * Small fix to the `offer_throughput` option in the async client's `create_database_if_not_exists` method, which was previously misspelled as `offerThroughput`.
    See [PR 32076](https://github.com/Azure/azure-sdk-for-python/pull/32076).

    #### Features Added
    * Added Support for Subpartitioning in Python SDK. See [PR 31121](https://github.com/Azure/azure-sdk-for-python/pull/31121)
